    private async Task RegisterResidence()
    {
        ResidenceManager residenceManager = new ResidenceManager();

        residenceManager.ManagerFirstName = residence.ManagerFirstName;
        residenceManager.ManagerLastName = residence.ManagerLastName;

        BackendlessUser managerAccount = new BackendlessUser();
        managerAccount.Email = residence.Email;
        managerAccount.Password = residence.Password;

        residenceManager.ManagerAccount = managerAccount;

        BackendlessUser savedManager = await ResLinkUserRegistration.RegisterManagerAccount(residenceManager);

        if(savedManager != null)
        {
            Residence newResidence = new Residence();
            newResidence.ResidenceName = residence.ResidenceName;

            newResidence = await ResidenceRepository.SaveResidence(newResidence);

            if(newResidence != null)
            {
                object[] children = new object[] { savedManager };
                await Backendless.Data.Of<Residence>().SetRelationAsync(newResidence, "residenceManager", children);
            }
        }

    }


